export const union = (back, next, length, a, b) => {
	if (length[a] < length[b]) {
		const c = a;
		a = b;
		b = c;
	}

	next[back[a]] = b;
	back[a] = back[b];

	for (let c = next[a]; c !== b; c = next[c]) back[c] = back[b];

	length[a] += length[b];

	return a;
};

