export default function identity(n, List = Array) {
	const a = new List(n);

	for (let i = 0; i < n; ++i) a[i] = i;

	return a;
}

export {default as _RankedTreeUniverse} from './_RankedTreeUniverse.js';
export {default as ones} from './ones.js';
export {default as nulls} from './nulls.js';
export {default as identity} from './identity.js';
export {default as rankedtreeunion} from './rankedtreeunion.js';
export {default as zeros} from './zeros.js';

export default function nulls(n, List = Array) {
	const a = new List(n);

	for (let i = 0; i < n; ++i) a[i] = -1;

	return a;
}

export default function ones(n, List = Array) {
	const a = new List(n);

	for (let i = 0; i < n; ++i) a[i] = 1;

	return a;
}

export default function rankedtreeunion(p, r, a, b) {
	if (r[a] < r[b]) {
		p[a] = b;
		return b;
	}

	if (r[a] > r[b]) {
		p[b] = a;
		return a;
	}

	p[b] = a;
	++r[a];
	return a;
}

export default function zeros(n, List = Array) {
	const a = new List(n);

	for (let i = 0; i < n; ++i) a[i] = 0;

	return a;
}

